// Handler creates http.Handler with routing matching OpenAPI spec.
func Handler(si ServerInterface) http.Handler {
	return HandlerWithOptions(si, GorillaServerOptions{})
}

type GorillaServerOptions struct {
	BaseURL          string
	BaseRouter       *mux.Router
	Middlewares      []MiddlewareFunc
	ErrorHandlerFunc func(w http.ResponseWriter, r *http.Request, err error)
}

// HandlerFromMux creates http.Handler with routing matching OpenAPI spec based on the provided mux.
func HandlerFromMux(si ServerInterface, r *mux.Router) http.Handler {
	return HandlerWithOptions(si, GorillaServerOptions{
		BaseRouter: r,
	})
}

func HandlerFromMuxWithBaseURL(si ServerInterface, r *mux.Router, baseURL string) http.Handler {
	return HandlerWithOptions(si, GorillaServerOptions{
		BaseURL:    baseURL,
		BaseRouter: r,
	})
}

// HandlerWithOptions creates http.Handler with additional options
func HandlerWithOptions(si ServerInterface, options GorillaServerOptions) http.Handler {
	r := options.BaseRouter

	if r == nil {
		r = mux.NewRouter()
	}
	if options.ErrorHandlerFunc == nil {
		options.ErrorHandlerFunc = func(w http.ResponseWriter, r *http.Request, err error) {
			http.Error(w, err.Error(), http.StatusBadRequest)
		}
	}
	wrapper := ServerInterfaceWrapper{
		Handler:            si,
		HandlerMiddlewares: options.Middlewares,
		ErrorHandlerFunc:   options.ErrorHandlerFunc,
	}

	r.HandleFunc(options.BaseURL+"/social/voice-lobby", wrapper.CreateLobby).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/available", wrapper.GetAvailableLobbies).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/directory", wrapper.GetLobbyDirectory).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/events/{lobby_id}", wrapper.GetLobbyEvents).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/integration/guild/{guild_id}", wrapper.CreateLobbyForGuild).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/integration/party/{party_id}", wrapper.CreateLobbyForParty).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/party-finder/create-group", wrapper.CreatePartyFinderGroup).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/party-finder/invite", wrapper.InvitePartyFinderPlayer).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/party-finder/search", wrapper.SearchPartyFinder).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/search", wrapper.SearchLobbies).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}", wrapper.DeleteLobby).Methods("DELETE")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}", wrapper.GetLobby).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}", wrapper.UpdateLobby).Methods("PUT")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}/join", wrapper.JoinLobby).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}/leave", wrapper.LeaveLobby).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}/permissions", wrapper.GetLobbyPermissions).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}/permissions/check", wrapper.CheckLobbyPermission).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}/permissions/{player_id}", wrapper.SetLobbyPermission).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}/subchannels", wrapper.ListSubchannels).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}/subchannels", wrapper.CreateSubchannel).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}/subchannels/{subchannel_id}/join", wrapper.JoinSubchannel).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice-lobby/{lobby_id}/subchannels/{subchannel_id}/leave", wrapper.LeaveSubchannel).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/channels", wrapper.ListChannels).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/channels", wrapper.CreateChannel).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/channels/create", wrapper.CreateVoiceChannel).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/channels/{channel_id}", wrapper.GetChannel).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/channels/{channel_id}/detail", wrapper.GetChannelDetail).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/channels/{channel_id}/join", wrapper.JoinChannel).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/channels/{channel_id}/leave", wrapper.LeaveChannel).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/channels/{channel_id}/participants", wrapper.GetChannelParticipants).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/channels/{channel_id}/participants/{player_id}/position", wrapper.UpdateParticipantPosition).Methods("PUT")

	r.HandleFunc(options.BaseURL+"/social/voice/channels/{channel_id}/participants/{player_id}/status", wrapper.UpdateParticipantStatus).Methods("PUT")

	r.HandleFunc(options.BaseURL+"/social/voice/events/{channel_id}", wrapper.GetVoiceEvents).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/mixer/configure", wrapper.ConfigureAudioMixer).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/mixer/status", wrapper.GetMixerStatus).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/participants/{participant_id}/deafen", wrapper.DeafenParticipant).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/participants/{participant_id}/kick", wrapper.KickParticipant).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/participants/{participant_id}/mute", wrapper.MuteParticipant).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/proximity/nearby/{player_id}", wrapper.GetNearbyPlayers).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/proximity/update", wrapper.UpdateProximityPosition).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/quality/presets", wrapper.GetQualityPresets).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/quality/set", wrapper.SetQuality).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/quality/status", wrapper.GetQualityStatus).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/stats/channels", wrapper.GetChannelStats).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/stats/participants", wrapper.GetParticipantStats).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/stats/quality", wrapper.GetQualityStats).Methods("GET")

	r.HandleFunc(options.BaseURL+"/social/voice/webrtc/connect", wrapper.ConnectWebRTC).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/webrtc/disconnect", wrapper.DisconnectWebRTC).Methods("POST")

	r.HandleFunc(options.BaseURL+"/social/voice/webrtc/token", wrapper.GetWebRTCToken).Methods("POST")

	return r
}
